import myProfile from "../../images/me/me_profile.jpg";
import classes from "./Header.module.css";

const Header = () => {
  const LeftNav = () => {
    return (
      <div className={classes["photo-and-name"]}>
        <img
          src={myProfile}
          className={`${classes.profileImg} margin-center`}
          alt="jon photo"
        />
        <a href="#">
          <h4 className={classes["headerName"]}>Jonathan Guerrero</h4>
        </a>
      </div>
    );
  };

  const Nav = () => {
    const items = [
      { name: "About Me", href: "#aboutMe" },
      { name: "Certificate", href: "#certificate" },
      { name: "Projects", href: "#projects" },
      { name: "Hobbies", href: "#hobbies" },
      { name: "Contact", href: "#contact" },
    ];

    return (
      <div className={classes["nav"]}>
        {items.map((item) => (
          <h4>
            <a className={classes["nav-link"]} href={items.href}>
              {item.name}
            </a>
          </h4>
        ))}
      </div>
    );
  };

  return (
    <div className={classes["main-header"]}>
      <div className={`${classes["main-nav container p1"]} `}>
        <nav className={classes["navbar"]}>
          <LeftNav />
          <Nav />
        </nav>
      </div>
    </div>
  );
};

export default Header;
